import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

class Human {
  constructor(name, age) {
    this.name = name;
    this.age = age;
  }

  getDescription() {
    return `${this.name}は${this.age}歳です`;
  }

  canVote() {
    return this.age >= 18;
  }

  getLifeStage() {
    if (this.age <= 12) {
      return "子供";
    } else if (this.age <= 19) {
      return "青年";
    } else if (this.age <= 65) {
      return "大人";
    } else {
      return "シニア";
    }
  }
}

function Welcome(props) {
  return (
    <div>
      <p>{props.human.getDescription()}</p>
      <p>
        {props.human.name}は{props.human.getLifeStage()}です
      </p>
      <p>
        {props.human.name}は
        {props.human.canVote() ? "投票できます" : "投票できません"}
      </p>
    </div>
  );
}

function App() {
  return (
    <div>
      <Welcome human={new Human("alice", 27)} />
      <Welcome human={new Human("Bob", 33)} />
      <Welcome human={new Human("Satoru", 27)} />
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
